import React, { Component } from 'react';

export default class Head extends Component{
    constructor(props){
        super(props)
    }

    componentDidMount(){
        function Person() {
            this.name = "shshs";
            this.age = 24;

            this.print = function(){
                console.log(this.name + '  ', this.age);
            }
        }
        function Son() {
            Person.call(this)
            this.study = 'study';

            this.play = function(){
                console.log('son play!');
            }
        }

        var son  = new Son()

        son.print();
    }

    render(){
        return(
            <div className="header-box">
                div
            </div>
        )
    }
}
